	('Blessings upon you and welcome to Mag Mell. Times are changing and so is the majetic Hibernia that we once knew. The intensity of the realm war against Albion and Midgard has brought much concern to our leaders. King Lug has returned from the Veil and taken his throne in Tir Na Nog once again. Even Fagan has been uneasy about the safety of his people here in Mag Mell.\\n\\nThe realm war has taken most of the garrison that guarded our small town.  When the sentinels had patrolled with regular numbers they had their hands full with Siabra and other creatures. Now they can barely handle patrolling the town perimeter with their skeletal force.  I have a message for our local healer, Epona. The realm war is taking a toll on our brave men and women fighting in the frontlines and the Path of Elders informed us that they are recruiting as many Healers as they can find for the frontiers. I need you to deliver Epona a message informing her of this news. She may have a few tasks for you.', 'Hib.SearchForKnowledge.Story', 'EN', '', '2015-07-16 06:43:50', '156e6fdd-9341-4888-b3d1-9d3518a4f27e'),
