	('Long have we known that demonic creatures lurk below.  Darkness Falls is but one example.  Recently, more evil managed to bubble to the surface.  When the Headmasters of the Academy moved the Shrouded Isles portal from it\'s former home to Cotswold, they inadvertently created a tear in the fabric of reality.  This tear allowed evil to claws it\'s way to the surface!\\n\\nLuckily, this was noticed immediately by a Sorceress involved in the project, and the hole was capped, disallowing entry by the demons into our world.  Until a permanent solution is found, there is worry that they will amass their numbers in an effort to break free.  Some of our townsfolk have taken it upon themselves to venture inside to reduce the number of demons.  Alarmingly, there are reports of encountering our enemies from Hibernia and Midgard within, as well.\\n\\nYou must familiarize yourself with the entrance to Demon\'s Breach, so that you will know where to go to keep the forces of evil, Hibernia and Midgard at bay.\\n\\n', 'Alb.ToReachTheBreach.Story', 'EN', '', '2015-07-16 06:43:54', '222e7c1e-6e40-4333-a8a7-037f22d509f0'),
