	('What an exhausting day! The Academy sent me to Cotswold to be an advisor on matters of magic and such, and I\'m happy to be of service, but there are days when my research takes a lot out of me. It seems like I\'ve been a bit busier lately. Cotswold has become a hub of many goings-on lately, some of which are mundane and some are of a more diabolical nature.\\n\\nTake, for example, the nearby Burial Tomb, to our south-southeast. The Romans that occupied this region of Britain had a penchant for crypts, tombs, mausoleums and the like. Over the course of hundreds of years, the nearby tombs became home to hundreds of fearsome creatures, many of whom took up residence below, away from daylight and men above. Some of these previously normal creatures are twisted versions of themselves. By what foul sorcery, can only be guessed.\\n\\nTaskmaster Traint is seeking out volunteers to eradicate the creatures that moved into the tomb. You\'ll want to make yourself familiar with where to find it.\\n\\n', 'Alb.TombWithAView.Story', 'EN', '', '2015-07-16 06:43:52', '381cba47-da12-4912-960f-73c28c7f817b'),
