	('During my patrols of Cotswold, I\'ve seen many things that gravely concern me, my friend. The dead, are restless, and walk aboveground when they should be resting peacefully below. While this isn\'t quite a new phenomenon, there are more and more sightings of skeletons, zombies, and the like since that accursed accident.\\nYou\'ve likely heard by now about the tear in the fabric of reality that happened accidentally when the finger-wagglers at the Academy moved the portal leading to the Shrouded Isles from Avalon Marsh to here in Cotswold. They opened a door into hell, and I don\'t think anyone knows just yet what that means. They think they capped it, but I\'m not so sure.\\nWhile I can\'t be certain about what foul magic brings these \'things\' forth from their final resting places, I do know these abominations can\'t be allowed to roam the countryside. I\'m authorized to pay a bounty to anyone who puts them down and returns to me with proof of the deed.', 'Alb.AfterTheAccident.Story', 'EN', '', '2015-07-16 06:43:56', '6b6c3535-03be-42f4-aa7e-6016bb23e277'),
