	('Ich bin besorgt ??????????????????ber den R??????????????????ckgang der feenhaften Kreaturen, die in diesen dicht besiedelten Gebieten verbleiben. W??????????????????hrend ich mir sicher bin, dass sie uns gegen??????????????????ber keine Liebe empfinden, nachdem sie dazu gezwungen wurden, sich zu verstecken - oder andernfalls das Risiko einzugehen, die Aufmerksamkeit der Kirche zu erregen-, waren sie selten b??????????????????swillig.\\n\\nJedoch sprachen k??????????????????rzlich einige Dorfbewohner davon, Mitglieder der winzigen Wesen angetroffen zu haben, die sich abnormal verhielten; nahezu unheimlich. Kinder werden entf??????????????????hrt, Bauern ohne Provokation angegriffen, Nahrung vergiftet, das Vieh nachts in seinem Gehege get??????????????????tet. Es ist fast so, als st??????????????????nden sie unter einer Art Verzauberung, aber ich bin auch kein religi??????????????????ser Fanatiker. Wenn K??????????????????nig Artus in seinem Herzen die alten Wege respektieren konnte, dann werde ich dies auch schaffen.\\n\\nIch muss das weiter untersuchen, und ich k??????????????????nnte Eure Hilfe gebrauchen, wenn Ihr so nett w??????????????????rt, mir zu helfen.', 'Alb.WhenGoodBrowniesGoBad.Story', 'DE', '', '2015-07-16 06:43:55', '81d5e17d-70d0-4f70-9eff-d4936382d412'),
