	('Niemand ist mit diesem Namen online den Ihr kicken k??????????????????nnt!', 'Scripts.Players.Boot.NoOneOnline', 'DE', '', '2015-07-16 06:43:54', '92ac6b51-9422-47ec-a0ae-352387b562c7'),
	('I remember what it was like to be a reckless youth. I think we all had our moments when we were younger. I try to tolerate the antics of out local mischievous youth the best I can. Adults that encourage that kind of behavior, however, really upsets me. Youth are impressionable by nature, and adults that take advantage of that need to be taught a lesson.\\n\\nTake the bandits in the forest, for example. Most of them are a bunch of young thugs with nothing better to do, without an apprenticeship to keep them out of trouble. A few of them, though, are young adults who recruit the teens of our town, for the sole purpose of causing trouble. Just last week, some of them vandalized the rear of Elvar\'s smithy with brownie\'s blood. And, one of them stole one of my best swords!\\n\\nSomething needs to be done about them. I know Sir Dorian is coordinating efforts to flush them out of the forest; perhaps you can do something to help?\\n\\n', 'Alb.RecruitingNothingButTrouble.Story', 'EN', '', '2015-07-16 06:44:01', '92af29de-4a34-4ac9-93c1-a4aab9d678bb'),
