	('Au cours de mes patrouilles autour de Cotswold, j\'ai vu beaucoup de choses qui me pr??occupent gravement, mon ami. Les morts, sont agit??s alors qu\'ils devraient se reposer paisiblement. Si ce n\'est pas un ph??nom??ne relativement nouveau, il ya de plus en plus d\'observations de squelettes, zombies, et autres depuis l\'accident maudite. \\N Vous avez probablement entendu ?? ces derniers jours de la d??chirure dans le tissu de la r??alit?? qui est arriv?? par erreur ?? l\'Acad??mie. Ils ont ouvert une porte dans l\'enfer, et je ne pense pas que quelqu\'un sache ce que cela signifie. Ils pensent, mais je ne suis pas si s??r. \\ N Je ne peux pas ??tre certain de ce que la magie immonde apporte qoit bien pour notre monde, nous ne pouvons pas permettre a ces abominations de se balad?? dans nos campagnes. Je suis autoris?? ?? verser une prime ?? ceux qui les lib??rent et reviens me voir avec la preuve de son acte.', 'Alb.AfterTheAccident.Story', 'FR', '', '2015-07-16 06:44:11', 'a0908de4-1f26-4abb-b8bb-c24fb4696257'),
