	('Diesen Befehl kann nur der Leiter der Chat-Gruppe geben.', 'Scripts.Players.Chatgroup.LeaderCommand', 'DE', '', '2015-07-16 06:43:54', 'b70b4702-b9be-4364-92ea-ee68d3c5af4e'),
	('Brother Lawrence recently called a meeting with the local militia leaders to discuss his concerns about the rise in the number of undead in our region, and how it may relate to the recent incident leading to the forming of the entrances into Demons\' Breach. I must say, his concerns trouble me. I don\'t pretend to know much about the how or why of it, but I do know that if these creatures pose a threat to our citizens, they must be put down.\\n\\nAccording to our reports, skeletons and decayed zombies are apparently two of the more dangerous things to worry about near Prydwen Ossuary. Their numbers and aggressive posture seem to be increasing. I fear that if they go unchallenged, we may find ourselves in quite a predicament. We mustn\'t have the undead legions gallivanting about Camelot Hills, after all!\\n\\nWhat say you?  Will you help to make our countryside safer by sending those vermin back to their resting places? Bring me proof of your deed should you embark upon this task.\\n\\n', 'Alb.CemmethsOrders.Story', 'EN', '', '2015-07-16 06:43:54', 'b70d7666-d763-4536-908b-9f2c8179d298'),
	('Preserver', 'PlayerClass.Warden.GetTitle.30', 'EN', '', '2015-07-16 06:43:52', 'b70e798d-d79a-4ce0-8c2e-a18fa18a8a42'),
