	('We assumed there would only be the trials. It turns out that somehow, the creatures of the Planes, after Atlantis\' fall, found the means to survive in the planes. They\'ve procreated. We even believe some creatures escaped to the planes that perhaps never had a part in the trials. But we can\'t be sure. All we know is that when Atlantis fell, it fell qzuckly. But, as for what lies beyond that portal, all I can say is the trials still [exist].', 'Hibernia.Arbiter.WhisperReceive.Text7', 'FR', '', '2015-07-16 06:43:50', 'b721deb6-6e8f-4339-89f5-75ce5eb178ba'),
