	('Ah, sie sprechen von den Eigenschaften die sie mehr als alles andere sch??????????????????tzten und von Pr??????????????????fungen, die andere Kulturen daraufhin testeten. Denjenigen, die diese Pr??????????????????fungen bestanden, wurden bessere F??????????????????higkeiten in ihren erlernten K??????????????????nsten versprochen. Wir wissen nicht wie, doch das ist, was sie studieren. Seht Ihr hier hinter mir den Stein mit den Hyroglyphen? Wir nennen ihn die [Tafel] des Schicksals.', 'Albion.Arbiter.WhisperReceive.Text1', 'DE', '', '2015-07-16 06:43:51', 'd0c946b8-9960-4d40-b0d9-a805968fba33'),
	('These are difficult times, indeed.  Those of us old enough to remember what things were like when Arthur was alive - well, it\'s difficult to think of what has been lost since then.  Those were the golden years.\\n\\nOh, King Constantine does his best, don\'t get me wrong!  We\'re lucky to have a king with his integrity guiding our realm.  But, it\'s just not the same.  You can\'t help but feel for him; he must know that everyone compares him to Arthur.  It must be maddening, considering Constantine has much more on his plate and no Merlin at his side.  And yet, they say Morgana is still out there, plotting from the shadows.  It\'s no wonder the local villages are in the state they are in.\\n\\nSpeaking of the state of our humble village, recent efforts at sending a message to the bandits didn\'t make much of an impact.  They continue to be a thorn in our side.  I\'m providing a bounty to anyone who teaches those rabble-rousers a lesson, granted they bring me proof of the deed.  Interested?', 'Alb.DredgeUpAPledge.Story', 'EN', '', '2015-07-16 06:43:53', 'd0d0a177-f36f-4b51-b607-a60b4c506809'),
