	('Assistant {0}', 'CraftersTitle.Assistant', 'EN', '', '2015-07-16 06:44:01', 'e7fa3b52-f732-4d95-9dd9-6fed7c840974'),
	('I\'m troubled by recent changes in the few fae creatures that are left in this densely-settled region. While I\'m sure they\'ve no love for our kind, after being forced to go into hiding - or else run the risk of attracting the attention of the Church - they\'ve seldom been a menace.  Meddlesome, yes, but seldom have they been malevolent.\\n\\nRecently, however, some villagers have spoken of having encounters with members of the wee folk that seem out of the ordinary; almost sinister, even. Children being abducted, farmers being attacked without provocation, foodstuffs being poisoned, livestock being slaughtered in their pens at night; it\'s almost as if they are under some kind of enchantment, or something.This is not like them. I might not be a follower of the old ways, but I\'m no religious zealot, either. If King Arthur found it in his heart to respect the old ways, then so shall I.\\n\\n  I must study this further, and I could use your help, if you\'d be kind enough to assist me.', 'Alb.WhenGoodBrowniesGoBad.Story', 'EN', '', '2015-07-16 06:43:55', 'e7fbabee-238d-417d-b40d-ad0baed0a0af'),
