	('Welcome to Cotswold! I see you\'re one of the latest arrivals to the outskirts of Camelot. If you\'re here to help with realm defense, you\'re most welcome. I\'m pleased to do my part in readying you for that experience.\\n\\nKing Constantine\'s hands are full dealing with the troubles that plague Albion. These are dark times, but we\'re a stalwart people and are fortunate to have a king that takes the well-being of his people seriously. Still, we\'re beset by many dangers. There\'s the threat of invasion by Midgard and Hibernia, precious relics to guard, lands to protect, and forces of evil that dwell below, awaiting the opportunity to strike.\\n\\nThe realm war is taking a toll on our women and men fighting in the frontlines. The Guild leaders informed us that they\'re recruiting as may Healers as possible for the Frontiers. I need you to deliver Pompin the Crier a message regarding this news. He\'ll see to it that this message makes it into the right hands. He may also have a task for you.', 'Alb.ANewHeroesWelcome.Story', 'EN', '', '2015-07-16 06:43:54', 'f42be4c5-a6f7-40a3-94df-b856127038e3'),
