	('My research into the cause of some of the change in behavior of some of the fae creatures in our area is going fairly well. Still, I\'ve not come to any conclusive results.  All the while, their malevolent antics have increased in frequency. I fear that if a cause or solution is not found soon, the Church will begin to take matters into its hands, and that will not bode well for any creature of the Old Ways.\\n\\n  I would attempt consulting with members of the druidic faith in nearby Salisbury Plains, but they\'re not the most social lot, and many of them are not fond of those of us that making our homes near the city.  I\'ve had a series of unfortunate encounters with them, myself, in the past.\\n\\nSo, I guess I will keep plugging away at it in hopes of discovering something of note.  If I could go to the druids with concrete evidence, they may listen to what I have to say.  To that end I could use your assistance, would you be inclined to help?', 'Alb.WhenBloodSpeaks.Story', 'EN', '', '2015-07-16 06:43:59', 'fd8cc10e-74f1-403b-b25e-20357b986194'),
